description:
Something Old - A Lover from the past, Robert, returns to tell the Bride, Sabrina, that his love for her still fills his soul. Is Sabrina truly bound by love to her Groom-to-Be, Jake? Something New - Jake's friend, Jason, longs for the touch of one particular older woman. Will his yearning be reciprocated by Marcia, Jake's Mother? Something Borrowed - Bridal party members, Peter &amp; Alexis are on borrowed time, as they are given the opportunity to caress their desires before the wedding is over and they have to return to living with miles &amp; miles in between them. Something Blue - The Groom's sister, Carolyn, can't help but be overcome by loneliness, as she feels abandoned by those that she loves most. But, when Cooper declares his love for her, will she let him into her heart? Say &quot;I do&quot; to Wedding Day from The Romance Line by New Sensations This is the only Crystal Dear video.

